import api from '../../api';
import React, { useEffect, useState } from 'react';
import styles from "./HomePage.module.css";
import { Link } from 'react-router-dom';
import { Navigate, useNavigate } from 'react-router-dom';
import { Button, ModalBody, ModalHeader, Modal } from 'react-bootstrap';
import SubscriptionPage from '../subscriptions/SubscriptionPage';
import Notify from '../notifyuser/Notify';
import CatalogPage from '../catalog/CatalogPage';

const HomePage = () => {
  const [showLogoutNotification, setShowLogoutNotification] = useState(false);
  const [isModalOpen, setIsModalOpen] = useState(true);
  const [notifyState, setNotifyState] = useState(false);
  const [modal, setShowModal] = useState(false);
  // const [userToken, setUserToken] = useState(null);


  useEffect(() => {
    const logoutNotification = localStorage.getItem('logoutNotification');
    const notify = localStorage.getItem('notifyState');
    console.log(notify);
    if (notify === true) {
      setNotifyState(true);
    }

    if (logoutNotification) {
      setShowLogoutNotification(true);
      localStorage.removeItem('logoutNotification');
    }
  }, []);
  const closeModal = () => {
    setIsModalOpen(false);
  };
  const navigate = useNavigate();

  return (
    <>

      <nav className="navbar navbar-expand-lg navbar-light bg-light">
        {/* <a className="navbar-brand" href="#">Navbar</a> */}
        <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
          <span className="navbar-toggler-icon"></span>
        </button>

        <div className="collapse navbar-collapse" id="navbarSupportedContent">
          <ul className="navbar-nav mr-auto">
            <li className="nav-item active">
              <a className="nav-link" href="#">Home <span className="sr-only">(current)</span></a>
            </li>
            <li className="nav-item">
              <Link to="/create-workout" className='nav-link'>Create workout</Link>
            </li>

            <li className="nav-item">
              <Link to="/login" className='nav-link'>Authorize</Link>
            </li>
          </ul>
          <form className="form-inline my-2 my-lg-0 mr-15">
            <input className="form-control mr-sm-2" type="search" placeholder="Search" aria-label="Search" />
            <button className="btn btn-outline-success my-2 my-sm-0 mx-2" type="submit">Search</button>
          </form>
        </div>
        <li className="nav-account">
          {localStorage.getItem('user_token') ? (
            <li><Link to="/account" className='nav-link'>User account <i class="fa-solid fa-user"></i></Link></li>
          ) : (
            <div class="modal" tabindex="-1">
  <div class="modal-dialog">
    <div class="modal-content">
      <div class="modal-header">
        <h5 class="modal-title">Modal title</h5>
        <button type="button" class="btn-close" data-bs-dismiss="modal" aria-label="Close"></button>
      </div>
      <div class="modal-body">
        <p>Modal body text goes here.</p>
      </div>
      <div class="modal-footer">
        <button type="button" class="btn btn-secondary" data-bs-dismiss="modal">Close</button>
        <button type="button" class="btn btn-primary">Save changes</button>
      </div>
    </div>
  </div>
</div>
          )}
        </li>

      </nav>

      <CatalogPage></CatalogPage>
      <div class="card text-center">

        <div class="card-body">
          <h5 class="card-title">Special title treatment</h5>
          <p class="card-text">Checkout for ready workout setups for ya!</p>
          {/* <a href="#" class="btn btn-primary">Go somewhere</a> */}
        </div>
        <div class="card-footer text-muted">
          Featured
        </div>
      </div>
      <SubscriptionPage></SubscriptionPage>
    </>
  );

};

export default HomePage;
